import React, { Component } from "react";
import Body from './Body';

class Table extends Component {
  render() {
    return (
      <table className="table">
        <thead>
          <tr>
            <th scope="col">#</th>
            <th scope="col">Name</th>
            <th scope="col">Price</th>
          </tr>
        </thead>
        <Body></Body>
      </table>
    );
  }
}

export default Table;
